import { useState } from 'react'

const Artists = () => {
  const [artists, setArtists] = useState([
    {
      id: 1,
      name: 'Jérémy Dutheil',
      job: 'Accordéoniste'
    },

    {
      id: 2,
      name: 'Martin Piatek',
      job: 'Accordéoniste'
    },

    {
      id: 3,
      name: 'Swing Cocktail',
      job: 'Groupe de jazz manouche'
    },

    {
      id: 4,
      name: 'Solal Poux',
      job: 'Guitariste'
    }
  ])

  return (
    <section>
      <h2>Nos artistes</h2>

      <div className="artists-list">
        {artists.map((artist) => (
          <div className="artist-item" key={artist.id}>
            <h3>{artist.name}</h3>
            <h4>{artist.job}</h4>
          </div>
        ))}
      </div>
    </section>
  )
}

export default Artists
